- Each player picks a faction;
- Delete any unpicked factions;
- Roll D20 to determine first player;
- Shuffle system tiles and deal out 2 to each player;
- Delete unused system tiles and first player die;
- Shuffle objective tokens belonging to your faction and deal them out, 2 to each opposing player (delete undealt tokens);
- First player places 1 of his/her system tiles, then decides to place units and/or factory on it. Afterwards, he/she MUST place objective tokens on all available objective spaces of that system tile (only 1 objective of each faction per system tile, placing objectives player has the most of first);
- Repeat previous step for each player in clockwise fashion until all system tiles have been placed;
- Each player places 1 Warp storm token, starting with player who placed last system tile and continuing in anticlockwise fashion.

End of setup, enjoy your session!

Warning! Board size must abide by following rule:
2 players         =>         2x3 system tiles
3 players         =>         3x3 system tiles
4 players         =>         4x3 system tiles
